using System;\nusing System.Collections.Generic;\n\npublic class Program\n{\n    public static bool HasMatchingItems(List<int> listA, List<int> listB)\n    {\n        // Create a HashSet for one of the lists\n        HashSet<int> set = new HashSet<int>(listA);\n\n        // Check if any item in listB exists in the HashSet\n        foreach (int b in listB)\n        {\n            if (set.Contains(b))\n            {\n                return true;\n            }\n        }\n        \n        return false;\n    }\n\n    public static void Main()\n    {\n        List<int> listA = new List<int> { 1, 2, 3, 4, 5 };\n        List<int> listB = new List<int> { 6, 7, 8, 9, 5 };\n\n        bool result = HasMatchingItems(listA, listB);\n        Console.WriteLine(result); // Output: True\n    }\n}